const Display = (props) => {
    return (
        <div>
        {props.data.map(item =>
          <Card onClick={history.push("/Menu")}>
            <CardContent>
              <Typography>{item.name}</Typography>
            </CardContent>
          </Card>
        )}
      </div>
    );
}

export default Display;
